import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
export default function Expenses(props) {
  return (
    <>
      {props.data.map((expense) => (
        <ExpenseItem
          classname="expenses"
          date={expense.date}
          title={expense.title}
          amount={expense.amount}
        />
      ))}
    </>
  );
}
